        .map(student => {
            const gradeObj = newGrades.find(grade => grade.studentId === student.id); // Find grade object for the student
            if (gradeObj) {
                student.grade = gradeObj.grade; // Update student's grade if found in newGrades
            } else {
                student.grade = 'N/A'; // Set grade to 'N/A' if not found
            }
            return student;
        });
}

export default updateStudentGradeByCity;

